/*Table structure for table `apply_shops` */

DROP TABLE IF EXISTS `apply_shops`;

CREATE TABLE `apply_shops` (
  `id` varchar(64) NOT NULL COMMENT '商户的商铺信息表id标识',
  `is_subscribe` int(11) DEFAULT '0' COMMENT '是否可以预约?0=不可以，1=可以',
  `type_menu_id` varchar(64) DEFAULT NULL COMMENT '分类菜单id,表示类别，表面该商铺隶属于该分类菜单下',
  `model` int(11) DEFAULT '0' COMMENT '布局model,0=默认',
  `shopsName` varchar(64) DEFAULT NULL COMMENT '商铺名称',
  `businessHours` varchar(64) DEFAULT NULL COMMENT '营业时间',
  `logo` varchar(255) DEFAULT NULL COMMENT '商铺logo或门面照片',
  `city` varchar(20) DEFAULT NULL COMMENT '城市',
  `contactNumber` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `position_info` varchar(255) DEFAULT NULL COMMENT '位置信息，地点名称,位置名称',
  `images` varchar(1024) DEFAULT NULL COMMENT '门店内外周边环境照片',
  `state` int(11) DEFAULT '0' COMMENT '状态,0=未提交审核,1=审核中,2=审核通过,3=审核不通过',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(64) DEFAULT 'admin' COMMENT '创建人。在这里表示商户，商铺用户的id，或openid',
  `modify` varchar(64) DEFAULT 'admin' COMMENT '修改人',
  `version` varchar(64) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商户的商铺信息表';

