/*Table structure for table `lbt_attribute` */

DROP TABLE IF EXISTS `lbt_attribute`;

CREATE TABLE `lbt_attribute` (
  `id` varchar(64) NOT NULL COMMENT '轮播图属性表id标识(根据id去图片表获取图片)',
  `setId` varchar(64) DEFAULT NULL COMMENT '分类菜单id,项目id，其他id。如果=0，则表示最顶级首页。如果=default_1，则表示默认',
  `indicator_dots` varchar(10) DEFAULT NULL COMMENT '是=true,否=flase,显示面板指示点',
  `indicator_color` varchar(10) DEFAULT NULL COMMENT '指示点颜色，color值',
  `indicator_active_color` varchar(10) DEFAULT NULL COMMENT '当前选中的指示点颜色，color值',
  `autoplay` varchar(10) DEFAULT NULL COMMENT '是=true,否=flase,自动切换',
  `interval_time` int(11) DEFAULT NULL COMMENT '自动切换时间间隔，毫秒ms',
  `duration` int(11) DEFAULT NULL COMMENT '滑动动画时长,毫秒ms',
  `state` int(11) DEFAULT '0' COMMENT '状态,0=正常,1=停用',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(64) DEFAULT 'admin' COMMENT '创建人',
  `modify` varchar(64) DEFAULT 'admin' COMMENT '修改人',
  `version` varchar(64) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='轮播图属性表';

