/*Table structure for table `release_info` */

DROP TABLE IF EXISTS `release_info`;

CREATE TABLE `release_info` (
  `id` varchar(64) NOT NULL COMMENT '发布数据信息表id标识',
  `address` varchar(255) DEFAULT NULL COMMENT '表示服务地址，服务范围地址，多个用“,”隔开。',
  `typeMenu_id` varchar(64) DEFAULT NULL COMMENT '分类菜单id， 在这里标识该数据归属于该id菜单',
