/*Table structure for table `user_apply_merchant` */

DROP TABLE IF EXISTS `user_apply_merchant`;

CREATE TABLE `user_apply_merchant` (
  `id` varchar(64) NOT NULL COMMENT '用户申请成为商户表id标识',
  `sfz` varchar(64) DEFAULT NULL COMMENT '身份证号',
  `realName` varchar(10) DEFAULT NULL COMMENT '真实姓名',
  `contactNumber` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `position_info` varchar(255) DEFAULT NULL COMMENT '位置信息',
  `images` varchar(1024) DEFAULT NULL COMMENT '营业执照、身份证正反面照片',
  `state` int(11) DEFAULT '0' COMMENT '状态,0=申请中,1=申请通过..',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(64) DEFAULT 'admin' COMMENT '创建人。在这里表示申请人，申请用户的id',
  `modify` varchar(64) DEFAULT 'admin' COMMENT '修改人',
  `version` varchar(64) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户申请成为商户表';

